import React from 'react'; 
import './ImageButton.css';

const ImageButton = ({path, onClick, altText}) => {
	return (
		<a onClick={onClick}>
			<img src={path} width='30' height='30' alt={altText} />
		</a>
	);
}
export default ImageButton;
